<section class="smartSystems">
    <div class="inner">
        <article class="content">
            <h2>Smart Systems</h2>
            <h3>Remote Reading System</h3>
            <p>Smart Water System is the state-of-the-art method that brings many benefits such as: bill reduction for consumers, operation cost decreases for utility, and water loss declines. Smart technology can change conventional water systems into instrumented, interconnected, and intelligent systems. This feature-rich systems offer high-technology solutions for the water sector that include digital meters and sensors, supervisory control, data acquisition, and geographic information.</p>
            <p>The smart utility network concept plays a significant role in the global efforts towards affordable, sustainable and pure water for all.</p>
            <a href="#"> <i class="fas fa-envelope"></i> Contact Us</a>
        </article>
        
