        <article class="content">
            <h2>Measure & Monitor <span> SMARTER </span></h2>
            <p>We believe that smart water metering is not just a matter of increased accuracy. It is also about  continuous innovation in advanced measurement and monitoring technologies. It helps water utilities minimize water leakage, reduce user complaints, and improve management. We enable you to measure pressure, temperature, level, flow, status and more across the water cycle networks.</p>
        </article> 
